
def gen_prime(n): 
	prime = [True for i in range(n+1)] 
	p = 2
	while (p * p <= n): 
		if (prime[p] == True): 
			for i in range(p * p, n+1, p): 
				prime[i] = False
		p += 1
	arr = []
	for i in range(2,len(prime)):
		if prime[i]:
			arr.append(i)
	return arr
def check_val(arr):
	size = len(arr)
	for i in range(size-1):
		if arr[i] == arr[i+1]:
			return ("Same "+str(arr[i]))
	return "Good"



